let initialElements = [
    { id: '1', content: 'Element 1' },
    { id: '2', content: 'Element 2' },
    { id: '3', content: 'Element 3' },
];
  

export default function Workspace() {
    const [characters, updateCharacters] = useState(initialElements);

    return (
        <div style={{background:'aqua', width:'200px', position:'absolute', right:'0'}}>
            <ElementsList elementsData = {characters} />
        </div>
    )
}
